import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  const Array = [...props.array]
  console.log(Array[0].title)
  return(
    <>
    {Array.forEach((element) =>{
      <div>
        <p>{element.title}</p>
        <ExpenseItem 
        title={element.title}
				amount={element.amount}
				date={element.date}
      />
      </div>
    })}
    </>

  );
}

export default Expenses;
